// Footer.js

import React from 'react';
import './Footer.css';
import facebookIcon from './logo/facebook.png';
import twitterIcon from './logo/twitter.png';
import instagramIcon from './logo/instagram.png';
import linkedinIcon from './logo/linkedin.png';
import discordIcon from './logo/discord.png';
import githubIcon from './logo/github.png';
import spectre from './logo/spectre.jpg';
import gmailIcon from './logo/gmail.png';

const Footer = () => {
  return (
    <footer>
      <div className="social-media-links">
        <a href="https://www.facebook.com" target="_blank" rel="noopener noreferrer">
          <img src={facebookIcon} alt="Facebook" />
        </a>
        <a href="https://www.twitter.com" target="_blank" rel="noopener noreferrer">
          <img src={twitterIcon} alt="Twitter" />
        </a>
        <a href="https://www.instagram.com" target="_blank" rel="noopener noreferrer">
          <img src={instagramIcon} alt="Instagram" />
        </a>
        <a href="https://www.instagram.com" target="_blank" rel="noopener noreferrer">
          <img src={spectre} alt="Instagram" />
        </a>
        <a href="https://www.instagram.com" target="_blank" rel="noopener noreferrer">
          <img src={gmailIcon} alt="Instagram" />
        </a>
        <a href="https://www.github.com" target="_blank" rel="noopener noreferrer">
          <img src={githubIcon} alt="GitHub" />
        </a>
        <a href="https://www.discord.com" target="_blank" rel="noopener noreferrer">
          <img src={discordIcon} alt="Discord" />
        </a>
        <a href="https://www.linkedin.com" target="_blank" rel="noopener noreferrer">
          <img src={linkedinIcon} alt="LinkedIn" />
        </a>
      </div>
    </footer>
  );
};

export default Footer;
